INSERT INTO `wp_options` VALUES (694,'_transient_acf_plugin_info_pro','a:18:{s:4:\"name\";s:26:\"Advanced Custom Fields PRO\";s:4:\"slug\";s:26:\"advanced-custom-fields-pro\";s:7:\"version\";s:6:\"5.8.11\";s:8:\"homepage\";s:36:\"https://www.advancedcustomfields.com\";s:6:\"author\";s:64:\"<a href=\"https://www.advancedcustomfields.com\">Elliot Condon</a>\";s:12:\"contributors\";a:1:{s:12:\"elliotcondon\";a:3:{s:7:\"profile\";s:36:\"https://www.advancedcustomfields.com\";s:6:\"avatar\";s:81:\"https://secure.gravatar.com/avatar/c296f449f92233e8d1102ff01c9bc71e?s=96&d=mm&r=g\";s:12:\"display_name\";s:22:\"Advanced Custom Fields\";}}s:8:\"requires\";s:3:\"4.7\";s:12:\"requires_php\";s:3:\"5.4\";s:6:\"tested\";s:5:\"5.4.1\";s:5:\"added\";s:10:\"2014-07-11\";s:12:\"last_updated\";s:10:\"2020-05-12\";s:11:\"description\";s:1349:\"<p>Use the Advanced Custom Fields plugin to take full control of your WordPress edit screens & custom field data.</p>\n\n<p><strong>Add fields on demand.</strong> Our field builder allows you to quickly and easily add fields to WP edit screens with only the click of a few buttons!</p>\n\n<p><strong>Add them anywhere.</strong> Fields can be added all over WP including posts, users, taxonomy terms, media, comments and even custom options pages!</p>\n\n<p><strong>Show them everywhere.</strong> Load and display your custom field values in any theme template file with our hassle free developer friendly functions!</p>\n\n<h4>Features</h4>\n<ul>\n<li>Simple & Intuitive</li>\n<li>Powerful Functions</li>\n<li>Over 30 Field Types</li>\n<li>Extensive Documentation</li>\n<li>Millions of Users</li>\n</ul>\n\n<h4>Links</h4>\n<ul>\n<li><a href=\"https://www.advancedcustomfields.com\">Website</a></li>\n<li><a href=\"https://www.advancedcustomfields.com/resources/\">Documentation</a></li>\n<li><a href=\"https://support.advancedcustomfields.com\">Support</a></li>\n<li><a href=\"https://www.advancedcustomfields.com/pro/\">ACF PRO</a></li>\n</ul>\n\n<h4>PRO</h4>\n<p>The Advanced Custom Fields plugin is also available in a professional version which includes more fields, more functionality, and more flexibility! <a href=\"https://www.advancedcustomfields.com/pro/\">Learn more</a></p>\";s:12:\"installation\";s:503:\"<p>From your WordPress dashboard</p>\n\n<ol>\n<li><strong>Visit</strong> Plugins > Add New</li>\n<li><strong>Search</strong> for \"Advanced Custom Fields\"</li>\n<li><strong>Activate</strong> Advanced Custom Fields from your Plugins page</li>\n<li><strong>Click</strong> on the new menu item \"Custom Fields\" and create your first Custom Field Group!</li>\n<li><strong>Read</strong> the documentation to <a href=\"https://www.advancedcustomfields.com/resources/getting-started-with-acf/\">get started</a></li>\n</ol>\";s:9:\"changelog\";s:2079:\"<h4>5.8.11</h4>\n<p><em>Release Date - 12 May 2020</em></p>\n\n<ul>\n<li>Fix - Fixed bug in ACF Blocks where \"inserter examples\" and \"block templates\" did not load the defined \"data\".</li>\n<li>Fix - Reverted \"fix\" in 5.8.9 regarding Taxonomy fields saving terms to non \"post\" objects.</li>\n<li>Fix - Fixed bug allowing the Image field to save the value of a deleted attachment.</li>\n<li>Fix - Improved Select field <code>format_value()</code> behaviour to correctly cast value types depending on the \"multiple\" setting.</li>\n<li>Tweak - Changed language fallback for \"zh_HK\" to \"zh_TW\".</li>\n<li>Tweak - Changed Time Picker field settings to display in a localized format via <code>date_i18n()</code>.</li>\n<li>Tweak - Improved CSS styling of menu item fields.</li>\n<li>i18n - Updated Finnish translation thanks to Mikko Kekki</li>\n<li>i18n - Updated French translation thanks to Maxime Bernard-Jacquet.</li>\n<li>i18n - Updated Turkish translation thanks to Emre Erkan.</li>\n</ul>\n\n<h4>5.8.10</h4>\n<p><em>Release Date - 12 May 2020</em></p>\n\n<ul>\n<li>See hotfix version 5.8.11 for release notes.</li>\n</ul>\n\n<h4>5.8.9</h4>\n<p><em>Release Date - 26 March 2020</em></p>\n\n<ul>\n<li>Fix - Fixed bug in ACF Blocks causing default \"align\" property to be ignored.</li>\n<li>Fix - Fixed bug allowing Taxonomy field to save terms to a non \"post\" object.</li>\n<li>Tweak - Improved User field AJAX query performance.</li>\n<li>Tweak - Improved logic that determines width of Range field input.</li>\n<li>Tweak - Improved styling of ACF Blocks components.</li>\n<li>Dev - Added new \"acf/register_block_type_args\" filter.</li>\n<li>Dev - Added new generic ACF_Ajax_Query and ACF_Ajax_Query_Users classes.</li>\n<li>i18n - Updated French Canadian translation thanks to Bérenger Zyla.</li>\n<li>i18n - Updated Traditional Chinese translation thanks to Audi Lu.</li>\n<li>i18n - Updated German translation thanks to Ralf Koller.</li>\n<li>i18n - Updated Portuguese translation thanks to Pedro Mendonça.</li>\n</ul>\n\n<p><a href=\"https://www.advancedcustomfields.com/changelog/\">View the full changelog</a></p>\";s:14:\"upgrade_notice\";s:0:\"\";s:5:\"icons\";a:1:{s:7:\"default\";s:63:\"https://ps.w.org/advanced-custom-fields/assets/icon-256x256.png\";}s:7:\"banners\";a:2:{s:3:\"low\";s:77:\"https://ps.w.org/advanced-custom-fields/assets/banner-772x250.jpg?rev=1729102\";s:4:\"high\";s:78:\"https://ps.w.org/advanced-custom-fields/assets/banner-1544x500.jpg?rev=1729099\";}s:8:\"versions\";a:108:{i:0;s:11:\"5.9.0-beta1\";i:1;s:5:\"5.8.9\";i:2;s:5:\"5.8.8\";i:3;s:5:\"5.8.7\";i:4;s:5:\"5.8.6\";i:5;s:5:\"5.8.5\";i:6;s:5:\"5.8.4\";i:7;s:5:\"5.8.3\";i:8;s:5:\"5.8.2\";i:9;s:5:\"5.8.1\";i:10;s:13:\"5.8.0-beta4.1\";i:11;s:11:\"5.8.0-beta4\";i:12;s:11:\"5.8.0-beta3\";i:13;s:11:\"5.8.0-beta2\";i:14;s:11:\"5.8.0-beta1\";i:15;s:9:\"5.8.0-RC2\";i:16;s:9:\"5.8.0-RC1\";i:17;s:5:\"5.8.0\";i:18;s:5:\"5.7.9\";i:19;s:5:\"5.7.8\";i:20;s:5:\"5.7.7\";i:21;s:5:\"5.7.6\";i:22;s:5:\"5.7.5\";i:23;s:5:\"5.7.4\";i:24;s:5:\"5.7.3\";i:25;s:5:\"5.7.2\";i:26;s:6:\"5.7.13\";i:27;s:6:\"5.7.12\";i:28;s:6:\"5.7.10\";i:29;s:5:\"5.7.1\";i:30;s:5:\"5.7.0\";i:31;s:5:\"5.6.9\";i:32;s:5:\"5.6